import React from 'react';
import Card from './Card';

const CardList = ({ data }) => {
  return (
    <div>
      {
        data.map((user, i) => {
          return (
            <div class="container">
  <div class="row">
    <div class="col-sm">
  <Card
    key={i}
    count={i}
    songUrl={data[i].previewUrl}
    imageUrl={data[i].artworkUrl100}
    songName={data[i].collectionCensoredName}
    />
      One of three columns
    </div>
  </div>
</div>
          );
        })
      }
    </div>
  );
}

export default CardList;
